hr_data = streams.get("heartrate").data
resp_data = streams.get("TymeBreathRate").data

hr_sum = 0
resp_sum = 0
count = 0

for (i = interval.start_index; i < interval.end_index; i++) {
    if (hr_data[i] > 0 && resp_data[i] > 0) {
        hr_sum += hr_data[i]
        resp_sum += resp_data[i]
        count++
    }
}

hr_resp_ratio = hr_sum / resp_sum
